    id: 'about',
    lightBg: false,
    lightText: true,
    lightTextDesc: true,
    topLine: 'Premium Think',
    headline: 'Unlimited Thinking',
    description: 'just do fresh your thougths to be grown up strongly and be free like a bird.',
    buttonLabel: 'Get Started',
    imgStart: false,
    img: ('images/svg-1.svg'),
    alt: 'think',
    primary: true,
    darkText: false,
    dark: true,
    dark2: true,
}

export const homeObjTwo = {
  id: "discover",
  lightBg: true,
